import "./SearchBar.css";

function SearchBar() {


    return (
        <>
            <input
                type="search"
                placeholder="Last Name"
                name="last_name"
                value={contact.last_name || ""}
                onChange={inputChange}
                className="form-control"
            ></input>
        </>
    );
}

export default SearchBar;
